    <div className="rightbar">
      <div className="rightbarWrapper">
        {profile ? (
          <div>
            <Birthday />
            <Add />
            <OnlineFriends />)
          </div>
        ) : (
          <div>hi</div>
        )}
      </div>
    </div>
  );
}
